import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState("location");
  const [formData, setFormData] = useState({
    state: "",
    city: "",
    orgType: "",
    goal: "",
  });

  const handleBack = () => {
    navigate(-1);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
          style={{ filter: "brightness(0.7) saturate(0.7)" }}
        />
        <div className="absolute inset-0 bg-cyan-900/30 mix-blend-multiply"></div>
      </div>

      {/* 返回按钮 */}
      <button
        onClick={handleBack}
        className="absolute top-8 left-8 text-white hover:text-cyan-100 transition-colors z-10"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 pt-32 px-4 sm:px-6 lg:px-8">
        <div className="max-w-5xl mx-auto text-center mb-12">
          <h1 className="text-5xl font-bold text-white mb-4">
            Let's Find Your Perfect Partner
          </h1>
          <p className="text-xl text-cyan-50">
            Discover organizations that align with your mission and values
          </p>
        </div>

        {/* 搜索区域 */}
        <div className="max-w-4xl mx-auto bg-white rounded-xl shadow-lg overflow-hidden">
          {/* 标签栏 */}
          <div className="flex border-b">
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "location"
                  ? "text-cyan-600 border-b-2 border-cyan-600 bg-cyan-50"
                  : "text-gray-500 hover:text-gray-700"
              }`}
              onClick={() => setActiveTab("location")}
            >
              📍 Location
            </button>
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "type"
                  ? "text-cyan-600 border-b-2 border-cyan-600 bg-cyan-50"
                  : "text-gray-500 hover:text-gray-700"
              }`}
              onClick={() => setActiveTab("type")}
            >
              🏢 Organization Type
            </button>
            <button
              className={`flex-1 px-6 py-4 text-sm font-medium ${
                activeTab === "goal"
                  ? "text-cyan-600 border-b-2 border-cyan-600 bg-cyan-50"
                  : "text-gray-500 hover:text-gray-700"
              }`}
              onClick={() => setActiveTab("goal")}
            >
              🎯 Partnership Goal
            </button>
          </div>

          {/* 内容区域 */}
          <div className="p-6">
            {activeTab === "location" && (
              <div className="grid grid-cols-2 gap-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    State
                  </label>
                  <select
                    className="w-full rounded-lg border-gray-300 focus:border-cyan-500 focus:ring-cyan-500"
                    value={formData.state}
                    onChange={(e) =>
                      setFormData({ ...formData, state: e.target.value })
                    }
                  >
                    <option value="">Select State</option>
                    {/* 添加州选项 */}
                  </select>
                </div>
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-1">
                    City
                  </label>
                  <select
                    className="w-full rounded-lg border-gray-300 focus:border-cyan-500 focus:ring-cyan-500"
                    value={formData.city}
                    onChange={(e) =>
                      setFormData({ ...formData, city: e.target.value })
                    }
                  >
                    <option value="">Select City</option>
                    {/* 添加城市选项 */}
                  </select>
                </div>
              </div>
            )}

            {activeTab === "type" && (
              <div className="grid grid-cols-2 gap-4">
                <button
                  className={`p-6 rounded-lg border-2 text-left transition-colors ${
                    formData.orgType === "nonprofit"
                      ? "border-cyan-600 bg-cyan-50"
                      : "border-gray-200 hover:border-cyan-300"
                  }`}
                  onClick={() =>
                    setFormData({ ...formData, orgType: "nonprofit" })
                  }
                >
                  <h3 className="text-lg font-medium">🌍 Nonprofit</h3>
                  <p className="text-sm text-gray-500 mt-1">
                    NGOs, charities, and social organizations
                  </p>
                </button>
                <button
                  className={`p-6 rounded-lg border-2 text-left transition-colors ${
                    formData.orgType === "forprofit"
                      ? "border-cyan-600 bg-cyan-50"
                      : "border-gray-200 hover:border-cyan-300"
                  }`}
                  onClick={() =>
                    setFormData({ ...formData, orgType: "forprofit" })
                  }
                >
                  <h3 className="text-lg font-medium">💼 For-Profit</h3>
                  <p className="text-sm text-gray-500 mt-1">
                    Companies and businesses looking to make an impact
                  </p>
                </button>
              </div>
            )}

            {activeTab === "goal" && (
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-1">
                  What Kind of Organization Are You Looking For?
                </label>
                <textarea
                  className="w-full rounded-lg border-gray-300 focus:border-cyan-500 focus:ring-cyan-500"
                  rows="4"
                  placeholder="Describe your ideal partnership..."
                  value={formData.goal}
                  onChange={(e) =>
                    setFormData({ ...formData, goal: e.target.value })
                  }
                ></textarea>
              </div>
            )}
          </div>

          {/* 搜索按钮 */}
          <div className="px-6 py-4 bg-gray-50 text-right">
            <button className="px-8 py-3 bg-cyan-600 text-white rounded-lg hover:bg-cyan-700 transition-colors">
              Search Partners
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
